function clicked(element) {
    val = keyVal(element)
    //console.log('clicked ' + val)
    addChoice(val)
    print()
    verify()
    return false;
}

function onover(element) {
    val = keyVal(element)
    //console.log('over ' + val)
    $("#current").text(val)
}

function onout(element) {
    //console.log('out of ' + keyVal(element))
    $("#current").text('')
}

var CORRECT = 'fe372b9edacb99e7e12c80d9712eb3a63b52e8ad12866214d25be0cbf8503704'
var NEXT = '{"iv":"DMq2yh1I6KfeQmASB9lJsQ==","v":1,"iter":10000,"ks":128,"ts":64,"mode":"ccm","adata":"","cipher":"aes","salt":"w8m8cjcRo7k=","ct":""}'

var buff = []

function addChoice(value) {
    buff.unshift(value)
    while (buff.length > 8) {
        buff.pop()
    }
}

function print() {
    for (var i = 0; i < 8; i++) {
        $("#c" + i).text(buff[i])
    }
}

function verify() {
    if (buff.length != 8) return
    var content = ""
    for (var i = 7; i >= 0; i--) {
        content += '-'
        content += buff[i]
    }
    var hash = sjcl.codec.hex.fromBits(sjcl.hash.sha256.hash(content))
    console.log(content + ": " + hash)
    if (hash == CORRECT) {
        console.log('correct ' + hash)
        plain = sjcl.decrypt(content, NEXT)

        $('#solution').html(plain)
    }
}

function keyVal(element) {
    return element.getAttribute('id').replace(/^a/, "")
}

