function init(pwd, msg) {
    hash = sjcl.codec.hex.fromBits(sjcl.hash.sha256.hash(pwd))
    cypher = sjcl.encrypt(pwd, msg)
    if (sjcl.decrypt(pwd, cypher) != msg) console.log('Unable to decompress')

    CORRECT = hash
    NEXT = cypher
}
